import React from 'react';
import './Avatar.css';
import PropTypes from 'prop-types';

const Avatar = () => {
  return (
    <div className="Avatar">
      <img className="placeholder" src={this.prop.url} alt="Neopet Avatar"/>
    </div>
  );
}

Avatar.propTypes = {
  url: PropTypes.string
  // iamge url, adds image to border
};

export default Avatar;
